DROP TABLE IF EXISTS `wp_posts`;
CREATE TABLE `wp_posts` (
  `ID` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_author` bigint(20) unsigned NOT NULL DEFAULT '0',
  `post_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_date_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content` longtext COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `post_title` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `post_excerpt` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `post_status` varchar(20) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT 'publish',
  `comment_status` varchar(20) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT 'open',
  `ping_status` varchar(20) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT 'open',
  `post_password` varchar(255) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT '',
  `post_name` varchar(200) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT '',
  `to_ping` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `pinged` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `post_modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_modified_gmt` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `post_content_filtered` longtext COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `post_parent` bigint(20) unsigned NOT NULL DEFAULT '0',
  `guid` varchar(255) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT '',
  `menu_order` int(11) NOT NULL DEFAULT '0',
  `post_type` varchar(20) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT 'post',
  `post_mime_type` varchar(100) COLLATE utf8mb4_unicode_520_ci NOT NULL DEFAULT '',
  `comment_count` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`),
  KEY `post_name` (`post_name`(191)),
  KEY `type_status_date` (`post_type`,`post_status`,`post_date`,`ID`),
  KEY `post_parent` (`post_parent`),
  KEY `post_author` (`post_author`)
) ENGINE=MyISAM AUTO_INCREMENT=251 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
INSERT INTO `wp_posts` VALUES (243,1,'2022-10-08 22:24:02','2022-10-08 22:24:02','<h2>CV</h2>		\n			<article>				\n									admin								\n									January 17, 2022								\n				<object data=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/01/CV.pdf\" type=\"application/pdf\" style=\"width:100%;height:600px\" aria-label=\"PDF embed\"></object></p>\n			</article><!-- .obfx-grid-container --><!-- .obfx-grid -->		\n			<a href=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/10/CV_Artemi_Sementsenko_AS2778.pdf\" role=\"button\">\n						Download CV (PDF)\n					</a>\n					<a href=\"https://twitter.com/johnysem\" target=\"_blank\" rel=\"noopener\">\n						Twitter\n											</a>\n					<a href=\"https://www.linkedin.com/in/artemi-sementsenko-26a6591b6/\" target=\"_blank\" rel=\"noopener\">\n						Linkedin\n											</a>\n					<a href=\"https://github.com/artemijsem\" target=\"_blank\" rel=\"noopener\">\n						Github\n											</a>','CV','','inherit','closed','closed','','184-revision-v1','','','2022-10-08 22:24:02','2022-10-08 22:24:02','',184,'http://as2778.brighton.domains/portfolio/?p=243',0,'revision','',0),(239,1,'2022-10-08 22:23:19','2022-10-08 22:23:19','','CV_Artemi_Sementsenko_AS2778-1','','inherit','open','closed','','cv_artemi_sementsenko_as2778-1','','','2022-10-08 22:23:19','2022-10-08 22:23:19','',202,'http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/10/CV_Artemi_Sementsenko_AS2778-1.pdf',0,'attachment','application/pdf',0),(240,1,'2022-10-08 22:23:26','2022-10-08 22:23:26','<!-- wp:file {\"id\":239,\"href\":\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/10/CV_Artemi_Sementsenko_AS2778-1.pdf\",\"showDownloadButton\":false,\"displayPreview\":true} -->\n<div class=\"wp-block-file\"><object class=\"wp-block-file__embed\" data=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/10/CV_Artemi_Sementsenko_AS2778-1.pdf\" type=\"application/pdf\" style=\"width:100%;height:600px\" aria-label=\"Embed of CV_Artemi_Sementsenko_AS2778-1.\"></object><a id=\"wp-block-file--media-00de4d2e-dbf6-4ed3-820b-9ea117a3aa14\" href=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/10/CV_Artemi_Sementsenko_AS2778-1.pdf\">CV_Artemi_Sementsenko_AS2778-1</a></div>\n<!-- /wp:file -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','','','inherit','closed','closed','','202-revision-v1','','','2022-10-08 22:23:26','2022-10-08 22:23:26','',202,'http://as2778.brighton.domains/portfolio/?p=240',0,'revision','',0),(218,1,'2022-01-17 22:30:38','2022-01-17 22:30:38','<h1>Artemi Sementsenko</h1>\n<h2>Coder &amp; Gamer</h2>		\n															<img width=\"207\" height=\"194\" src=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/dadaddad.png\" alt=\"\" loading=\"lazy\" />															\n			<h3>About me</h3>		\n		<p>I am an undergraduate student at the <strong>University of Brighton</strong> getting degree in <strong>BSc(Hons) Computer Science for Games</strong> who wants to become a <strong>Game Developer</strong>. </p><p>I have played video games since I was a child and had always found them interesting. It was the best escape from real world for me and I knew that I can come back to them anytime I want.</p><p>After discovering programming in college I have decided that I want to dedicate my life to game programming. </p><p>I like to code, but I am also interested in other parts of game development, so occasionally I venture to different parts such as <strong>Sound</strong>, <strong>3D modelling</strong> and <strong>Animation</strong>.</p>		\n			<h3>Skills</h3>		\n			<p>Software</p>		\n			<h5>Languages</h5>		\n			<h5>Other</h5>		\n		<p style=\"text-align: center;\"></p><ul><li style=\"text-align: left;\">Visual Studio</li><li style=\"text-align: left;\">Unity</li><li style=\"text-align: left;\">Unreal Engine 4</li><li style=\"text-align: left;\">Git</li></ul><p style=\"text-align: center;\"></p><ul><li>C#</li><li>C++</li><li>HTML/CSS</li><li>Python</li></ul><p style=\"text-align: center;\"></p><ul><li>Trello</li><li>Russian (Native)</li><li>English (Fluent)</li><li>Estonian (Conversant)</li></ul>		\n			<h3>Education</h3>		\n		<p><strong>University of Brighton         2021 - Present</strong></p>		\n		<p><strong>Falmouth University             2020 - 2021</strong></p>		\n		<p><strong>Narva Keeltelüseum             2017 - 2020</strong></p>','Home','','inherit','closed','closed','','13-revision-v1','','','2022-01-17 22:30:38','2022-01-17 22:30:38','',13,'http://as2778.brighton.domains/portfolio/?p=218',0,'revision','',0),(175,1,'2022-01-17 19:34:33','2022-01-17 19:34:33','','PlaceHolder','','inherit','open','closed','','placeholder','','','2022-01-17 19:34:33','2022-01-17 19:34:33','',20,'http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/01/PlaceHolder.png',0,'attachment','image/png',0),(176,1,'2022-01-17 19:36:33','2022-01-17 19:36:33','<h2>Portfolio</h2>		\n												<figure>\n											<a href=\"https://midenistis.itch.io/what-happened-to-charlie\">\n							<img width=\"750\" height=\"366\" src=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/portfolio_01.png\" alt=\"\" loading=\"lazy\" srcset=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/portfolio_01.png 790w, http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/portfolio_01-300x147.png 300w, http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/portfolio_01-768x375.png 768w\" sizes=\"(max-width: 750px) 100vw, 750px\" />								</a>\n											<figcaption>My Uni Project at Falmouth University <br />  <b>Role:</b> Programmer</figcaption>\n										</figure>','Portfolio','','inherit','closed','closed','','20-revision-v1','','','2022-01-17 19:36:33','2022-01-17 19:36:33','',20,'http://as2778.brighton.domains/portfolio/?p=176',0,'revision','',0),(177,1,'2022-01-17 19:36:33','2022-01-17 19:36:33','<h2>Portfolio</h2>		\n												<figure>\n				