played video games since I was a child and had always found them interesting. It was the best escape from real world for me and I knew that I can come back to them anytime I want.</p><p>After discovering programming in college I have decided that I want to dedicate my life to game programming. </p><p>I like to code, but I am also interested in other parts of game development, so occasionally I venture to different parts such as <strong>Sound</strong>, <strong>3D modelling</strong> and <strong>Animation</strong>.</p>		\n			<h3>Skills</h3>		\n			<p>Software</p>		\n			<h5>Languages</h5>		\n			<h5>Other</h5>		\n		<p style=\"text-align: center;\"></p><ul><li style=\"text-align: left;\">Visual Studio</li><li style=\"text-align: left;\">Unity</li><li style=\"text-align: left;\">Unreal Engine 4</li><li style=\"text-align: left;\">Git</li></ul><p style=\"text-align: center;\"></p><ul><li>C#</li><li>C++</li><li>HTML/CSS</li><li>Python</li></ul><p style=\"text-align: center;\"></p><ul><li>Trello</li><li>Russian (Native)</li><li>English (Fluent)</li><li>Estonian (Conversant)</li></ul>		\n			<h3>Education</h3>		\n		<p><strong>University of Brighton         2021 - Present</strong></p>		\n		<p><strong>Falmouth University             2020 - 2021</strong></p>		\n		<p><strong>Narva Keeltelüseum             2017 - 2020</strong></p>		\n			<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-widget-social-icons.elementor-grid-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-mobile-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-tablet-0 .elementor-widget-container{line-height:1;font-size:0}.elementor-widget-social-icons:not(.elementor-grid-0):not(.elementor-grid-tablet-0):not(.elementor-grid-mobile-0) .elementor-grid{display:inline-grid}.elementor-widget-social-icons .elementor-grid{grid-column-gap:var(--grid-column-gap,5px);grid-row-gap:var(--grid-row-gap,5px);grid-template-columns:var(--grid-template-columns);-webkit-box-pack