04 21:34:53','2021-12-04 21:34:53','<h2>Portfolio</h2>		\n			<iframe frameborder=\"0\" src=\"https://itch.io/embed/1018970?linkback=true&amp;dark=true\" width=\"208\" height=\"167\"><a href=\"https://midenistis.itch.io/what-happened-to-charlie\">What Happened To Charlie? by Midenistís, Artemi Sementsenko, Hayley Davies</a></iframe>		\n			<h3>This is the heading</h3>		\n			<h3>This is the heading</h3>		\n			<h3>This is the heading</h3>		\n			<h3>This is the heading</h3>		\n		<p>My Uni project at Falmouth University. </p><p><strong>Role:</strong> Programmer</p>','Portfolio','','inherit','closed','closed','','20-revision-v1','','','2021-12-04 21:34:53','2021-12-04 21:34:53','',20,'http://as2778.brighton.domains/portfolio/?p=146',0,'revision','',0),(170,1,'2022-01-17 18:24:23','2022-01-17 18:24:23','','CV','','inherit','open','closed','','as2778_cv','','','2022-01-17 21:18:42','2022-01-17 21:18:42','',0,'http://as2778.brighton.domains/portfolio/wp-content/uploads/2022/01/AS2778_CV.pdf',0,'attachment','application/pdf',0),(171,1,'2022-01-17 18:28:54','2022-01-17 18:28:54','<h1>Artemi Sementsenko</h1><h2>Coder &amp; Gamer</h2>		\n															<img width=\"207\" height=\"194\" src=\"http://as2778.brighton.domains/portfolio/wp-content/uploads/2021/12/dadaddad.png\" alt=\"\" loading=\"lazy\" />															\n			<h3>About me</h3>		\n		<p>I am an undergraduate student at the <strong>University of Brighton</strong> getting degree in <strong>BSc(Hons) Computer Science for Games</strong> who wants to become a <strong>Game Developer</strong>. </p><p>I have played video games since I was a child and had always found them interesting. It was the best escape from real world for me and I knew that I can come back to them anytime I want.</p><p>After discovering programming in college I have decided that I want to dedicate my life to game programming. </p><p>I like to code, but I am also interested in other parts of game development, so occasionally I venture to different parts such as <strong>Sound</strong>, <strong>3D modelling</strong> and <strong>Animation</strong>.</p>		\n			<h3>Skills</h3>		\n			<p>Software</p>		\n			<h5>Languages</h5>		\n			<h5>Other</h5>		\n		<p style=\"text-align: center;\"></p><ul><li style=\"text-align: left;\">Visual Studio</li><li style=\"text-align: left;\">Unity</li><li style=\"text-align: left;\">Unreal Engine 4</li><li style=\"text-align: left;\">Git</li></ul><p style=\"text-align: center;\"></p><ul><li>C#</li><li>C++</li><li>HTML/CSS</li><li>Python</li></ul><p style=\"text-align: center;\"></p><ul><li>Trello</li><li>Russian (Native)</li><li>English (Fluent)</li><li>Estonian (Conversant)</li></ul>		\n			<h3>Education</h3>		\n		<p><strong>University of Brighton         2021 - Present</strong></p>		\n		<p><strong>Falmouth University             2020 - 2021</strong></p>		\n		<p><strong>Narva Keeltelüseum             2017 - 2020</strong></p>','Home','','inherit','closed','closed','','13-revision-v1','','','2022-01-17 18:28:54','2022-01-17 18:28:54','',13,'http://as2778.brighton.domains/portfolio/?p=171',0,'revision','',0),(149,1,'2021-12-04 21:47:40','2021-12-04 21:47:40','<h2>Send me a message</h2>\n<form action=\"http://as2778.brighton.domains/portfolio/wp-admin/admin-post.php\" method=\"post\" name=\"content-form-b417921\" id=\"content-form-b417921\"><input type=\"hidden\" id=\"_wpnonce_contact\" name=\"_wpnonce_contact\" value=\"d67c066422\"><input type=\"hidden\" name=\"_wp_http_referer\" value=\"/portfolio/wp-admin/admin-ajax.php\"><input type=\"hidden\" name=\"action\" value=\"content_form_submit\"><input type=\"hidden\" name=\"form-type\" value=\"contact\"><input type=\"hidden\" name=\"form-builder\" value=\"elementor\"><input type=\"hidden\" name=\"post-id\" value=\"18\"><input type=\"hidden\" name=\"form-id\" value=\"b417921\">\n<fieldset><label for=\"data[b417921][name]\">Name *</label><input type=\"text\" name=\"data[b417921][name]\" id=\"data[b417921][name]\" required=\"required\" placeholder=\"Name\"